    "Simple Radiowave-Based Method for Measuring Peripheral Blood Flow Project",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:21:08.534874",nt"name": "simple-radiowave-based-method-for-measuring-peripheral-blood-flow-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;This technology will be a quantum
    advance in hemodynamic monitoring and will be applicable in numerous situations
    such as for immediate assessment and monitoring of patients in life-threatening
    emergencies, during environmental stressors, and in performance of hazardous occupational
    tasks. For NASA these benefits will apply to both flight and ground personnel. For
    the military this device can be used during actual combat to alert medical personnel
    when a service member is wounded and to monitor his/her condition even before help
    is provided thus lowering medical evaluation times. This can also be used to aid
    medical personnel allowing them to prioritize triage and evacuation in multiple
    casualty contingencies.&lt;/p&gt;",nt"license_title": "U.S. Government Work",nt"extras":
